import React from "react";
import Card from "./Card";
import contacts from "../contacts";
import Avatar from "./Avatar"

function createCode(contact) {
  return <Card
    id={contact.id}
    key={contact.id}
    name={contact.name}
    img={contact.imgURL}
    phone={contact.phone}
    email={contact.email}
  />
}

